import React from "react";
import { Card } from "@material-ui/core";

const Playlist = () => {
  return (
    <div>
        <p>Currently listening to</p>
        <div class="circle"> 
        <iframe
          title="spotify"
          src="https://open.spotify.com/embed/playlist/62W2MjEoHtmobGgcaMurP9"
          width="300"
          height="380"
          frameBorder="0"
          allow="encrypted-media"
        ></iframe>
        </div>
    </div>
  );
};

export default Playlist;
